import logo from './logo.svg';
import Navbar from 'react-bootstrap/Navbar'
import Container from 'react-bootstrap/Container'
import data from './data.js'
import './App.css';

function App() {

  const {products} = data
  return (
    <div className="App" >
      <header>
         <Navbar className='bg-green' data-bs-theme="dark">
            <Container>
                <Navbar.Brand href='#'>BioNourri</Navbar.Brand>
            </Container>
         </Navbar>

      </header>

      <main>
          <div>
            {
              products.map((x)=>{

                  <div key={x.slug}>
                    <img src={x.image} alt={x.name}/>
                    <p>
                      {x.name}
                    </p>
                    <p>
                      <strong>Price : </strong>{x.price}
                    </p>
                  </div>
              })
            }
          </div>
      </main>
    </div>
  );
}

export default App;
